  true,\n\t\"url\": null,\n\t\"notes\": \"In order to better define the size of the
  thermal anomaly in the Raft River Valley, Idaho, the U.S. Geological Survey drilled
  a series of intermediate-depth (nominal 500-ft depth) wells in 1977 and 1978. This
  report presents geologic, geophysical, and temperature data for these drill holes,
  along with data for five wells drilled by the Idaho National Engineering Laboratory
  with U.S. Department of Energy funding. Data previously reported for other drill
  holes are also included in order to make them available as digital files.\",\n\t\"license_title\":
